const BASE_URL = 'http://localhost:3000'
const TODOS_URL = `${BASE_URL}/todos`
export const FETCH_TODOS = 'FETCH_TODOS'

export const fetchTodos = () => dispatch =>  {
        fetch(TODOS_URL)
        .then(res => res.json())
        .then(todos => 
            dispatch({
            type: FETCH_TODOS,
            todos
        })
    )
}
